using SixLabors.ImageSharp;
using SixLabors.ImageSharp.Formats.Jpeg;
using SixLabors.ImageSharp.Processing;
using System;
using System.IO;
using System.Threading.Tasks;

namespace Core.Services.Image
{
    public class ImageService : IImageService
    {
        const int thumbnailSize = 256;
        const int fullscreenSize = 1000;

        public async Task<Stream> Compress(Stream stream)
        {
            using var image = SixLabors.ImageSharp.Image.Load(stream);
            var options = new ResizeOptions
            {
                Size = new Size(fullscreenSize, 0),
                Mode = ResizeMode.Max
            };
            image.Mutate(x => x.Resize(options));
            image.Metadata.ExifProfile = null;
            var output = new MemoryStream();

            var encoder = new JpegEncoder()
            {
                Quality = 30 //Use variable to set between 5-30 based on your requirements
            };
            await image.SaveAsync(output, encoder);
            return output;
        }

        public async Task<Stream> GenerateThumbnail(Stream stream)
        {
            using var image = SixLabors.ImageSharp.Image.Load(stream);
            var options = new ResizeOptions
            {
                Size = new Size(thumbnailSize, 0),
                Mode = ResizeMode.Max
            };
            image.Mutate(x => x.Resize(options));
            image.Metadata.ExifProfile = null;
            var output = new MemoryStream();

            var encoder = new JpegEncoder()
            {
                //Quality = 50 //Use variable to set between 5-30 based on your requirements
            };
            await image.SaveAsync(output, encoder);
            return output;
        }

        public Stream GetStreamFromBase64(string base64)
        {
            // Example input:
            // data:image/png;base64,

            static string CleanBase64String(string s)
            {
                var found = s.IndexOf(",");
                return s.Substring(found + 1);
            }

            byte[] bytes = Convert.FromBase64String(CleanBase64String(base64));

            return new MemoryStream(bytes);
        }
    }
}
